import React, { useState, useEffect } from 'react';
import { ethers } from 'ethers';
import './App.css';

const CONTRACT_ADDRESS = "0x3E0d0Cb98388a743EaADbfA2032148c413516CFE";
const CONTRACT_ABI = [
  // Paste your contract ABI here
];

function App() {
  const [contract, setContract] = useState(null);
  const [account, setAccount] = useState("");
  const [gasResults, setGasResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [comparison, setComparison] = useState("");

  useEffect(() => {
    const init = async () => {
      if (window.ethereum) {
        try {
          await window.ethereum.request({ method: 'eth_requestAccounts' });
          const provider = new ethers.providers.Web3Provider(window.ethereum);
          const signer = provider.getSigner();
          setAccount(await signer.getAddress());

          const gasContract = new ethers.Contract(
            CONTRACT_ADDRESS,
            CONTRACT_ABI,
            signer
          );
          setContract(gasContract);

        } catch (error) {
          console.error("Error connecting:", error);
        }
      } else {
        alert("Please install MetaMask!");
      }
    };
    init();
  }, []);

  const executeTransaction = async (txType) => {
    if (!contract) return;
    setLoading(true);

    try {
      let tx;
      const startGas = await contract.provider.getBlock("latest").then(b => b.gasLimit);

      if (txType === "simple") {
        tx = await contract.simpleTransaction(100);
      } 
      else if (txType === "storage") {
        tx = await contract.storageTransaction(100);
      } 
      else if (txType === "complex") {
        tx = await contract.complexTransaction(100, "test");
      }

      const receipt = await tx.wait();
      const gasUsed = receipt.gasUsed.toString();

      setGasResults(prev => [...prev, {
        type: txType,
        gasUsed,
        txHash: tx.hash
      }]);

    } catch (error) {
      console.error("Transaction failed:", error);
    } finally {
      setLoading(false);
    }
  };

  const compareTransactions = async () => {
    if (!contract || gasResults.length < 2) return;

    try {
      const result = await contract.compareTransactions(
        gasResults[0].type === "simple" ? "Simple" : 
        gasResults[0].type === "storage" ? "Storage" : "Complex",
        gasResults[1].type === "simple" ? "Simple" : 
        gasResults[1].type === "storage" ? "Storage" : "Complex"
      );
      setComparison(result);
    } catch (error) {
      console.error("Comparison failed:", error);
    }
  };

  return (
    <div className="app">
      <header>
        <h1>Gas Fee Comparison DApp</h1>
        <p>Connected Account: {account ? `${account.substring(0, 6)}...${account.substring(38)}` : "Not connected"}</p>
      </header>

      <div className="transaction-section">
        <h2>Execute Transactions</h2>
        <div className="buttons">
          <button 
            onClick={() => executeTransaction("simple")}
            disabled={loading}
          >
            {loading ? "Processing..." : "Simple Transaction"}
          </button>
          <button 
            onClick={() => executeTransaction("storage")}
            disabled={loading}
          >
            {loading ? "Processing..." : "Storage Transaction"}
          </button>
          <button 
            onClick={() => executeTransaction("complex")}
            disabled={loading}
          >
            {loading ? "Processing..." : "Complex Transaction"}
          </button>
        </div>
      </div>

      <div className="results-section">
        <h2>Transaction Results</h2>
        <table>
          <thead>
            <tr>
              <th>Type</th>
              <th>Gas Used</th>
              <th>Transaction Hash</th>
            </tr>
          </thead>
          <tbody>
            {gasResults.map((result, index) => (
              <tr key={index}>
                <td>{result.type}</td>
                <td>{result.gasUsed}</td>
                <td>
                  <a 
                    href={`https://sepolia.etherscan.io/tx/${result.txHash}`} 
                    target="_blank" 
                    rel="noopener noreferrer"
                  >
                    {result.txHash.substring(0, 10)}...
                  </a>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        {gasResults.length >= 2 && (
          <div className="comparison">
            <button onClick={compareTransactions}>Compare Last Two Transactions</button>
            {comparison && <p>Comparison Result: {comparison}</p>}
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
